post_content = "The Bali 3mm wetsuit packs a lot of features for a great price. The blue/black colour creates a bold statement, while super-stretch neoprene and stylish graphics ensure you are ready to hit the warmer climates."
post_title = "Bali 3mm Wetsuit"
post_excerpt = "<ul>
 	<li>Super-stretch neoprene on shoulders, sleeves and armpits.</li>
 	<li>Heavy duty #10 zipper.</li>
 	<li>Flatlock stitch for comfort.</li>
 	<li>Back zipper water shield.</li>
 	<li>Pre-bent anatomic legs and arms.</li>
 	<li>Embossed knee pad in Supratex.</li>
 	<li>O-ring seals to finish the sleeves and limit water ingress.</li>
</ul>"
